const Contact = () =>{
    return(
        <>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-10 mx-auto">
                        <div className="row">
                            <div className="col-md-6 col-10 order-2 order-lg-1">

                            </div>
                            <div className="col-md-6 col-10 order-1 order-lg-1">

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Contact;
